import BackImg from "./assets/Untitled.png";
import React from "react";
import "./App.css";
import "./font/iran-sans.ttf";
import Profile from "./components/Profile/Profile";
import Header from "./components/Header/Header";
import Structure from "./components/Structure";
import "./components/Structure.css";
import ButtonContext from "./Context/button-context";
function App() {
  return (
    <div>
      <ButtonContext.Provider></ButtonContext.Provider>
      {" "}
      <img className="back" src={BackImg} alt=""></img>;
      <section className="struct">
        <div>
          <Profile></Profile>
        </div>
        <div>
          <Header></Header>
        </div>
        <Structure></Structure>
      </section>
    </div>
  );
}

export default App;
